import React, {useEffect, useState} from 'react';
import Box from '@mui/material/Box';
import {DataGrid, GridToolbar} from '@mui/x-data-grid';
import Button from '@mui/material/Button'; // Import Button from Material-UI
import axios from 'axios';
import Header from '../../components/Header';
import {allVehicleEndPoint} from '../../data/apiConstants';
import HandleException from '../../util/Toastify';
import {DirectionsBus} from '@mui/icons-material';
import {useTheme} from '@emotion/react';
import {tokens} from '../../theme';

function Vehicles() {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);
  const [data, setData] = useState([]);

  const columns = [
    { field: 'id', headerName: 'ID', flex: 1, hide: true },
    { field: 'seatingCapacity', headerName: 'Seating Capacity', flex: 1 },
    { field: 'model', headerName: 'Vehicle Model', flex: 2 },
    { field: 'vehicleNumber', headerName: 'Vehicle Number', flex: 2 },
    {
      field: 'update',
      headerName: 'Update',
      flex: 0.5,
      renderCell: (params) => (
        <Button variant="outlined" color="success">
          Update
        </Button>
      ),
    },
    {
      field: 'delete',
      headerName: 'Delete',
      flex: 0.5,
      renderCell: (params) => (
        <Button variant="outlined" color="error" onClick={() => handleDelete(params.row.id)}>
          Delete
        </Button>
      ),
    },
  ];

  const fetchData = () => {
    axios.get(allVehicleEndPoint)
    .then((response) => {
      setData(response.data.result);
    })
    .catch((error) => {
      HandleException(error)
    });
  };

  useEffect(() => {
    fetchData(); // Fetch data when the component mounts
  }, []);

  const handleDelete = (id) => {
    axios.delete("")
      .then((response) => {
        fetchData();
      })
      .catch((error) => {
        HandleException(error)
      });
  };

  return (
    <Box m="20px">
      <Header
        title="Vehicle"
        subtitle="Manage Vehicle"
      />
        <Box>
          <Button
            sx={{
              backgroundColor: colors.blueAccent[700],
              color: colors.grey[100],
              fontSize: "14px",
              fontWeight: "bold",
              padding: "10px 20px",
            }}
          >
            <DirectionsBus sx={{ mr: "10px" }} />
            Add Vehicle
          </Button>
        </Box>
      <Box
        m="40px 0 0 0"
        height="75vh"
        sx={{
          // Your styling here
        }}
      >
        <DataGrid
          rows={data}
          columns={columns}
          components={{ Toolbar: GridToolbar }}
        />
      </Box>
    </Box>
  );
}

export default Vehicles;
